    <StoriesChild>
      <div>
        <StoriesImg src={props.img} alt="rasm" />
      </div>
      <Avatar border src={props.img} alt="rasm" />
      <StoriesName>{props.ism}</StoriesName>
    </StoriesChild>
  );
};
